import React from 'react'
import '../styles/LawTexts'

class LawTexts extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            firstCountry: props.firstCountry,
            secondCountry: props.secondCountry
        }
    }
    render(){
        return(
            <center>
                <div className="row">
                    <div className="column">
                        First country is {this.state.firstCountry}.
                    </div>
                    <div className="column">
                        Second country is {this.state.secondCountry}.
                    </div>
                </div>
            </center>
        )
    }
}

export default LawTexts
